INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 0, 190804, 60000, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 1, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1, 2, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 3, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 1, 4, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2, 5, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2, 6, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 7, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 3, 8, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 3, 9, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3, 10, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3, 11, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 3, 12, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 4, 13, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 4, 14, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 4, 15, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4, 16, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60000, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4, 17, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 0, 190804, 60000, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, 18, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 190804, 60000, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, 19, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 101201, 80001, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 0, 20, "", "ハツネ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 101201, 80001, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 2, 0, 21, "", "ハツネ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 103801, 80001, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 0, 22, "", "シオリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 103801, 80001, 0, "来年も、\n一緒にいられたら…\nうれしいな", 2, 0, 23, "", "シオリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 103601, 80001, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 1, 0, 24, "", "キョウカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 103601, 80001, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 0, 25, "", "キョウカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 102001, 80001, 0, "おにいちゃんとあってから、\n1年たったよ～！", 1, 0, 26, "", "ミミ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 102001, 80001, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 0, 27, "", "ミミ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 2, 100401, 80001, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1, 0, 28, "", "ミソギ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 2, 100401, 80001, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 0, 29, "", "ミソギ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 101001, 80001, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1, 0, 30, "", "マホ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 101001, 80001, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2, 0, 31, "", "マホ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 104401, 80001, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 0, 32, "", "イリヤ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 104401, 80001, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2, 0, 33, "", "イリヤ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 3, 101701, 80001, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1, 0, 34, "", "カオリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 3, 101701, 80001, 0, "これからも、どうぞよろしく\nお願いするさ～！", 2, 0, 35, "", "カオリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 102801, 80001, 0, "あんたと出会ってからもうそんなに\nたつのね～", 1, 0, 36, "", "サレン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 102801, 80001, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 2, 0, 37, "", "サレン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 102501, 80001, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 0, 38, "", "スズメ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 102501, 80001, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 2, 0, 39, "", "スズメ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 104601, 80001, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 1, 0, 40, "", "タマキ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 104601, 80001, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 2, 0, 41, "", "タマキ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 104801, 80001, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 0, 42, "", "ミフユ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 104801, 80001, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 2, 0, 43, "", "ミフユ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 103201, 80001, 0, "あなたさまと出会ってもう1年…", 1, 0, 44, "", "アキノ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 103201, 80001, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 2, 0, 45, "", "アキノ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 103401, 80001, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 0, 46, "", "ユカリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 103401, 80001, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 2, 0, 47, "", "ユカリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 107101, 80001, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 1, 0, 48, "", "クリスティーナ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 107101, 80001, 0, "ともかくこれからも\n愉しませてくれよ☆", 2, 0, 49, "", "クリスティーナ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 7, 104701, 80001, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 0, 50, "", "ジュン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 7, 104701, 80001, 0, "見えないから分からないって？\nそれもそうだな…", 2, 0, 51, "", "ジュン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 103701, 80001, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 1, 0, 52, "", "トモ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 103701, 80001, 0, "これからもよろしくね！", 2, 0, 53, "", "トモ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 8, 100501, 80001, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 0, 54, "", "マツリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 8, 100501, 80001, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 2, 0, 55, "", "マツリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 100701, 80001, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 1, 0, 56, "", "ミヤコ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 100701, 80001, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 2, 0, 57, "", "ミヤコ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 9, 103101, 80001, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 0, 58, "", "シノブ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 9, 103101, 80001, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 2, 0, 59, "", "シノブ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 100901, 80001, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 1, 0, 60, "", "アンナ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 100901, 80001, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 2, 0, 61, "", "アンナ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 10, 101301, 80001, 0, "君と出会ってもう1年だって！\n早いねー！", 1, 0, 62, "", "ナナカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 10, 101301, 80001, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 2, 0, 63, "", "ナナカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105101, 80001, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 1, 0, 64, "", "ミツキ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105101, 80001, 0, "これからも、いろんなところを\n調べさせてね？", 2, 0, 65, "", "ミツキ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 105601, 80001, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 0, 66, "", "ルカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 105601, 80001, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 2, 0, 67, "", "ルカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 11, 102701, 80001, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", 1, 0, 68, "", "エリコ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 11, 102701, 80001, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 0, 69, "", "エリコ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 102301, 80001, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 1, 0, 70, "", "アヤネ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 102301, 80001, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 2, 0, 71, "", "アヤネ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 104201, 80001, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 0, 72, "", "チカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 104201, 80001, 0, "私のことを見守ってください\nできることなら、ずっと…", 2, 0, 73, "", "チカ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 102101, 80001, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 1, 0, 74, "", "クルミ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 102101, 80001, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 0, 75, "", "クルミ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 104901, 80001, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 1, 0, 76, "", "シズル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 104901, 80001, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 2, 0, 77, "", "シズル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 101101, 80001, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 0, 78, "", "リノ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 101101, 80001, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 2, 0, 79, "", "リノ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 100201, 80001, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 1, 0, 80, "", "ユイ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 100201, 80001, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 2, 0, 81, "", "ユイ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 14, 100101, 80001, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 0, 82, "", "ヒヨリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 14, 100101, 80001, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 2, 0, 83, "", "ヒヨリ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 100301, 80001, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 1, 0, 84, "", "レイ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 100301, 80001, 0, "キミに背中を預けられる日が、\n早くきますように", 2, 0, 85, "", "レイ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80001, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 1, 0, 86, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80001, 0, "これからもずっと、覚えていて\nくださいね！", 2, 0, 87, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80001, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 0, 88, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80001, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 2, 0, 89, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80001, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 1, 0, 90, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80001, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 0, 91, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 0, 112101, 60001, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, 92, "", "スズメ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1, 93, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 94, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1, 95, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1, 96, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 1, 97, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2, 98, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2, 99, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2, 100, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2, 101, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 102, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 3, 103, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 3, 104, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3, 105, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3, 106, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 3, 107, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 3, 108, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 3, 109, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 4, 110, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 4, 111, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 4, 112, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4, 113, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 4, 114, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 1, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 4, 115, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60001, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4, 116, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 0, 112101, 60001, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 2, 0, 117, "", "スズメ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 112101, 60001, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 0, 118, "", "スズメ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 105801, 80003, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 0, 119, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 105901, 80003, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 0, 120, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 105901, 80003, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 2, 0, 121, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 106001, 80003, 0, "え？　ちょっと\nいきなりなにっ？", 1, 0, 122, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 106001, 80003, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 0, 123, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 105801, 80003, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 2, 0, 124, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 105801, 80003, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 3, 0, 125, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 105901, 80003, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", 3, 0, 126, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 106001, 80003, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 3, 0, 127, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 105901, 80003, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 4, 0, 128, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 105801, 80003, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 4, 0, 129, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 106001, 80003, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 4, 0, 130, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 105901, 80003, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 5, 0, 131, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 5, 0, 132, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 190801, 80003, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 0, 133, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "げっ…カリンじゃない\nなんでもないわよ！", 6, 0, 134, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 190801, 80003, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 0, 135, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 7, 0, 136, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 190801, 80003, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 3, 0, 137, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 8, 0, 138, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 9, 0, 139, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 190801, 80003, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 4, 0, 140, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 10, 0, 141, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 190801, 80003, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 5, 0, 142, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80003, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 11, 0, 143, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 6, 0, 144, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 5, 0, 145, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 7, 0, 146, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 8, 0, 147, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 6, 0, 148, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 7, 0, 149, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 9, 0, 150, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 8, 0, 151, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 10, 0, 152, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "えへへ、ありがとうございます\nコッコロちゃん！", 9, 0, 153, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 105901, 80003, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 11, 0, 154, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105801, 80003, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 10, 0, 155, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 11, 0, 156, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 12, 0, 157, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 12, 0, 158, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 13, 0, 159, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 13, 0, 160, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "…積極的？\nなんの話よ？", 14, 0, 161, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 14, 0, 162, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 15, 0, 163, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 15, 0, 164, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 105801, 80003, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 16, 0, 165, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 16, 0, 166, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 106001, 80003, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 17, 0, 167, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 18, 0, 168, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80003, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 12, 0, 169, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 19, 0, 170, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80003, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 13, 0, 171, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 20, 0, 172, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80003, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 14, 0, 173, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 21, 0, 174, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80003, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 15, 0, 175, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "かくし芸？", 22, 0, 176, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80003, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 16, 0, 177, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80003, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 23, 0, 178, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 105801, 80003, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 17, 0, 179, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 24, 0, 180, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 105901, 80003, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 17, 0, 181, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 105801, 80003, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 18, 0, 182, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 25, 0, 183, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 105901, 80003, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 18, 0, 184, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 26, 0, 185, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 27, 0, 186, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 28, 0, 187, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 105801, 80003, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 19, 0, 188, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 105901, 80003, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 19, 0, 189, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 106001, 80003, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 29, 0, 190, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 30, 0, 191, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 31, 0, 192, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 32, 0, 193, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "あー\nあー\n…声、これで大丈夫かしら？", 33, 0, 194, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 34, 0, 195, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "オイッスー☆", 35, 0, 196, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 36, 0, 197, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 37, 0, 198, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80003, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 38, 0, 199, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 20, 0, 200, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 21, 0, 201, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 22, 0, 202, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 23, 0, 203, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 24, 0, 204, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "オイッスー☆", 25, 0, 205, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 26, 0, 206, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 27, 0, 207, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 105901, 80003, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 28, 0, 208, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "オイッスー☆", 20, 0, 209, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 21, 0, 210, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "あと６日で2.5周年ですか…", 22, 0, 211, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 23, 0, 212, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 24, 0, 213, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "オイッスー☆", 25, 0, 214, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 26, 0, 215, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 27, 0, 216, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 28, 0, 217, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 29, 0, 218, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 105801, 80003, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 30, 0, 219, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 31, 0, 220, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 10, 105901, 80003, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 29, 0, 221, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 32, 0, 222, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 10, 106001, 80003, 0, "…………", 39, 0, 223, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 10, 105901, 80003, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 30, 0, 224, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 10, 106001, 80003, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 40, 0, 225, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 33, 0, 226, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 10, 106001, 80003, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 41, 0, 227, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 34, 0, 228, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 35, 0, 229, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 10, 106001, 80003, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 42, 0, 230, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 10, 105901, 80003, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 31, 0, 231, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 10, 106001, 80003, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 43, 0, 232, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105801, 80003, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 36, 0, 233, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 6, 0, 234, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 7, 0, 235, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 8, 0, 236, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 9, 0, 237, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 10, 0, 238, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 0, 239, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 12, 0, 240, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 13, 0, 241, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "あれ？\nもしかして緊張で気を失って…？", 14, 0, 242, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 15, 0, 243, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 16, 0, 244, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 190801, 80003, 0, "それでは\nまた明日お会いしましょう♪", 17, 0, 245, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 106001, 80003, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 44, 0, 246, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 105801, 80003, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 37, 0, 247, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 105901, 80003, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 32, 0, 248, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 106001, 80003, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 45, 0, 249, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 105801, 80003, 0, "ひどいですよぉキャルちゃ～ん！", 38, 0, 250, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 105901, 80003, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 33, 0, 251, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 105801, 80003, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 39, 0, 252, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 106001, 80003, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 46, 0, 253, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 105901, 80003, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 34, 0, 254, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 105801, 80003, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 40, 0, 255, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 41, 0, 256, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 47, 0, 257, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "忘れてきちゃいました☆", 42, 0, 258, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 48, 0, 259, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 105901, 80003, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 35, 0, 260, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 49, 0, 261, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 43, 0, 262, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 50, 0, 263, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 105901, 80003, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 36, 0, 264, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 51, 0, 265, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 105901, 80003, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 37, 0, 266, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 52, 0, 267, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 44, 0, 268, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 105901, 80003, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 38, 0, 269, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 45, 0, 270, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 106001, 80003, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 53, 0, 271, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 105801, 80003, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 46, 0, 272, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "こんにちは\n【ギルド管理協会】のカリンです", 18, 0, 273, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "昨日の生放送は\nいかがだったでしょうか？", 19, 0, 274, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 20, 0, 275, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 21, 0, 276, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 22, 0, 277, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 23, 0, 278, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 24, 0, 279, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 25, 0, 280, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 26, 0, 281, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 190801, 80003, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 27, 0, 282, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "準備はいいですかっ？\n…いっきますよー！", 47, 0, 283, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "祝！", 54, 0, 284, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "2.5周年！", 39, 0, 285, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "おめでとうございま～す☆", 48, 0, 286, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 55, 0, 287, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 40, 0, 288, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 49, 0, 289, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 56, 0, 290, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 41, 0, 291, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 57, 0, 292, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 50, 0, 293, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 58, 0, 294, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "記念日だから\n平気平気♪\nやばいですね☆", 51, 0, 295, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "意味分かんないわよ！", 59, 0, 296, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 42, 0, 297, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 43, 0, 298, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 52, 0, 299, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 106001, 80003, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 60, 0, 300, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 105901, 80003, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 44, 0, 301, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 53, 0, 302, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 105801, 80003, 0, "2.5周年\nありがとうございます！", 54, 0, 303, "105901,45,106001,61", "ペコリーヌ・コッコロ・キャル", 1);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 0, 190804, 60002, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 304, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1, 305, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 306, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1, 307, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1, 308, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 1, 309, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2, 310, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 2, 311, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2, 312, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2, 313, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2, 314, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 3, 315, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 3, 316, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3, 317, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 3, 318, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 3, 319, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3, 320, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 3, 321, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 4, 322, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 4, 323, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 4, 324, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4, 325, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 4, 326, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 1, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 4, 327, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60002, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4, 328, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 0, 190804, 60002, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, 329, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 190804, 60002, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, 330, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 1, 105901, 80005, 0, "ささ、シェフィさまはこちらへ…", 1, 0, 331, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 106401, 80005, 0, "コッコロさん、どこへ行くの…？\n…え？", 1, 0, 332, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 1, 105801, 80005, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 0, 333, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 1, 105901, 80005, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 2, 0, 334, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 106401, 80005, 0, "ええと…\n二人とも何をしているの？", 2, 0, 335, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 106001, 80005, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 0, 336, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 106401, 80005, 0, "あの日…？", 3, 0, 337, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 1, 105801, 80005, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 2, 0, 338, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 1, 105801, 80005, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 0, 339, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 190801, 80005, 0, "やばいですね☆", 1, 0, 340, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 1, 106001, 80005, 0, "って、なにしれっと\n参加してんのよカリン！", 2, 0, 341, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 190801, 80005, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 0, 342, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 1, 190801, 80005, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 3, 0, 343, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 1, 105801, 80005, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 4, 0, 344, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 1, 106401, 80005, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 4, 0, 345, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 2, 105801, 80005, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 5, 0, 346, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 105901, 80005, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 3, 0, 347, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 105901, 80005, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 4, 0, 348, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 2, 105801, 80005, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 6, 0, 349, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 105901, 80005, 0, "さすがでございます\nペコリーヌさま", 5, 0, 350, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80005, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 3, 0, 351, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 2, 106401, 80005, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", 5, 0, 352, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 2, 105801, 80005, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 7, 0, 353, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 105901, 80005, 0, "さ、次はキャルさまの\n番でございますよ", 6, 0, 354, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80005, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 4, 0, 355, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 2, 106401, 80005, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 6, 0, 356, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80005, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 5, 0, 357, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80005, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 6, 0, 358, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 2, 105901, 80005, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 7, 0, 359, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 2, 106001, 80005, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 7, 0, 360, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105901, 80005, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 8, 0, 361, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 3, 105801, 80005, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 8, 0, 362, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105901, 80005, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 9, 0, 363, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 3, 106401, 80005, 0, "聖学祭…って、なにかしら？", 7, 0, 364, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 3, 105901, 80005, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 10, 0, 365, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 106001, 80005, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 8, 0, 366, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 106001, 80005, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 9, 0, 367, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 3, 105801, 80005, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 9, 0, 368, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 3, 106001, 80005, 0, "いや、そのまんますぎでしょ…", 10, 0, 369, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 3, 106401, 80005, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 8, 0, 370, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 3, 105801, 80005, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 10, 0, 371, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 3, 106401, 80005, 0, "えっ？　ええ…\nぎゅーっ…？", 9, 0, 372, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 11, 0, 373, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 4, 106401, 80005, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 10, 0, 374, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 12, 0, 375, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 105901, 80005, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 11, 0, 376, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 13, 0, 377, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 4, 105801, 80005, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 11, 0, 378, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 14, 0, 379, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 15, 0, 380, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 4, 106401, 80005, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 11, 0, 381, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 4, 105801, 80005, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 12, 0, 382, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 4, 105901, 80005, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 12, 0, 383, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 4, 106001, 80005, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 16, 0, 384, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 4, 106401, 80005, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 12, 0, 385, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 13, 0, 386, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 14, 0, 387, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 15, 0, 388, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80005, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 17, 0, 389, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80005, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 18, 0, 390, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 5, 106401, 80005, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 13, 0, 391, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 5, 105901, 80005, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 13, 0, 392, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 16, 0, 393, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 5, 106001, 80005, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 19, 0, 394, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 17, 0, 395, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 18, 0, 396, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 5, 105801, 80005, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 19, 0, 397, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 190801, 80005, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 4, 0, 398, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 190801, 80005, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 5, 0, 399, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 106001, 80005, 0, "…えっ！？", 20, 0, 400, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 6, 105801, 80005, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 20, 0, 401, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 106401, 80005, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 14, 0, 402, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 6, 105901, 80005, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 14, 0, 403, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 6, 106401, 80005, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 15, 0, 404, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 106001, 80005, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 21, 0, 405, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 6, 105801, 80005, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 21, 0, 406, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 6, 106001, 80005, 0, "ぶっ殺すぞ！？", 22, 0, 407, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 6, 190801, 80005, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 0, 408, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 7, 105901, 80005, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 15, 0, 409, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80005, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 23, 0, 410, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 7, 106401, 80005, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 16, 0, 411, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 105801, 80005, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 22, 0, 412, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80005, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 24, 0, 413, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 7, 106401, 80005, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 17, 0, 414, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 7, 105901, 80005, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 16, 0, 415, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 7, 106401, 80005, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 18, 0, 416, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 7, 105901, 80005, 0, "もちろんでございます\n仲良くお勉強いたしましょう", 17, 0, 417, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80005, 0, "しれっと教育ママが\n生まれてる…？", 25, 0, 418, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 105801, 80005, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 23, 0, 419, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 7, 106001, 80005, 0, "え～～～～！？", 26, 0, 420, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 106001, 80005, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 27, 0, 421, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 8, 106401, 80005, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 19, 0, 422, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 8, 105901, 80005, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 18, 0, 423, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 8, 105801, 80005, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 24, 0, 424, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 8, 106401, 80005, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 20, 0, 425, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 106001, 80005, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 28, 0, 426, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 8, 105901, 80005, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 19, 0, 427, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 8, 106401, 80005, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 21, 0, 428, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 106001, 80005, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 29, 0, 429, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 106001, 80005, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 30, 0, 430, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 8, 105801, 80005, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 25, 0, 431, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 8, 106001, 80005, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 31, 0, 432, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 22, 0, 433, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 23, 0, 434, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 24, 0, 435, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 25, 0, 436, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 26, 0, 437, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "それから、それから…！\nぅ、ぅぅっ…！", 27, 0, 438, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "―びえぇぇ～んっ！！！", 28, 0, 439, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 9, 105901, 80005, 0, "どうされましたか、シェフィさま", 20, 0, 440, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "ううっ…ひっく…\nママッ…！", 29, 0, 441, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 9, 105901, 80005, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 21, 0, 442, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 9, 105901, 80005, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 22, 0, 443, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 9, 106401, 80005, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 30, 0, 444, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "主さま\n3.5周年まであと５日\nでございます", 23, 0, 445, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "ですがその前に\n生放送がありますね", 24, 0, 446, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "…生放送に向けた\n意気込みでございますか？", 25, 0, 447, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 26, 0, 448, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 27, 0, 449, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 28, 0, 450, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 29, 0, 451, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 30, 0, 452, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 10, 105901, 80005, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 31, 0, 453, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "3.5周年まであと４日！\nやばいですね☆", 26, 0, 454, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 106001, 80005, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 32, 0, 455, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 27, 0, 456, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 28, 0, 457, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 29, 0, 458, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 106001, 80005, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 33, 0, 459, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 30, 0, 460, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 31, 0, 461, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 32, 0, 462, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 106001, 80005, 0, "だからあたしはやるなんて一言も…", 34, 0, 463, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 11, 105801, 80005, 0, "オイッスー☆", 33, 0, 464, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 11, 106001, 80005, 0, "聞きなさいっての！！", 35, 0, 465, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "3.5周年まであと３日…\nそして生放送は、明日…", 31, 0, 466, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 32, 0, 467, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", 33, 0, 468, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 34, 0, 469, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 35, 0, 470, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 12, 105801, 80005, 0, "やってますねシェフィちゃん！", 34, 0, 471, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 12, 106001, 80005, 0, "なによ、考えることは\nみんな同じってこと？", 36, 0, 472, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 12, 105901, 80005, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 32, 0, 473, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 12, 106401, 80005, 0, "みんな…もちろんよ！", 36, 0, 474, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 12, 105801, 80005, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 35, 0, 475, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 7, 0, 476, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 8, 0, 477, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 13, 105801, 80005, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 36, 0, 478, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 9, 0, 479, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 13, 105901, 80005, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 33, 0, 480, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 10, 0, 481, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 106001, 80005, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", 37, 0, 482, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 11, 0, 483, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 13, 106401, 80005, 0, "あうー？", 37, 0, 484, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 13, 105801, 80005, 0, "あ…", 37, 0, 485, "105901,34,106001,38,190801,12", "みんな", 1);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 13, 106001, 80005, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 39, 0, 486, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 13, 105901, 80005, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 35, 0, 487, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 13, 105801, 80005, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 38, 0, 488, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 13, 190801, 80005, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 0, 489, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 106401, 80005, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 38, 0, 490, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 14, 105801, 80005, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 39, 0, 491, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 106001, 80005, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 40, 0, 492, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 14, 105901, 80005, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 36, 0, 493, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 106401, 80005, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 39, 0, 494, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 14, 105801, 80005, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 40, 0, 495, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 14, 105901, 80005, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 37, 0, 496, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 14, 106001, 80005, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 41, 0, 497, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 106401, 80005, 0, "へ、へぇ…", 40, 0, 498, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 14, 105801, 80005, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 41, 0, 499, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 106401, 80005, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 41, 0, 500, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 14, 106401, 80005, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 42, 0, 501, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 15, 105801, 80005, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 42, 0, 502, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 106001, 80005, 0, "祝！", 42, 0, 503, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 15, 105901, 80005, 0, "3.5周年！", 38, 0, 504, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 106401, 80005, 0, "おめでとうございます！", 43, 0, 505, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 190801, 80005, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 14, 0, 506, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 15, 190801, 80005, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 0, 507, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 15, 105801, 80005, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 43, 0, 508, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 15, 105801, 80005, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 44, 0, 509, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 106001, 80005, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 43, 0, 510, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 15, 106001, 80005, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 44, 0, 511, "", "キャル", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 106401, 80005, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 44, 0, 512, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (0, 15, 106401, 80005, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 45, 0, 513, "", "シェフィ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 15, 105901, 80005, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 39, 0, 514, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 15, 105901, 80005, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 40, 0, 515, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 15, 105901, 80005, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 41, 0, 516, "", "コッコロ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 15, 105801, 80005, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 45, 0, 517, "", "ペコリーヌ", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (4, 15, 105801, 80005, 0, "これからも\nよろしくおねがいします！", 46, 0, 518, "105901,42,106001,45,106401,46,190801,16", "みんな", 1);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (1, 0, 190804, 60003, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 519, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1, 520, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 521, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 1, 522, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 1, 523, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 1, 524, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2, 525, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 2, 526, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 2, 527, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 2, 528, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2, 529, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 3, 530, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 3, 531, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3, 532, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 3, 533, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 3, 534, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3, 535, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 3, 536, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 4, 537, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 4, 538, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 4, 539, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 4, 540, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 4, 541, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 1, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 4, 542, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (2, 0, 0, 60003, 2, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0, 4, 543, "", "", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 0, 190804, 60003, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, 544, "", "カリン", 0);
INSERT INTO `v1_4f5c76c90ca443238977d91e21d8e94d09a7af13f6d3ed3a77e7434e0a4e1e66` VALUES (3, 7, 190804, 60003, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, 545, "", "カリン", 0);
